PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "spree_products" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255) DEFAULT '' NOT NULL, "description" text, "available_on" datetime, "deleted_at" datetime, "permalink" varchar(255), "meta_description" varchar(255), "meta_keywords" varchar(255), "tax_category_id" integer, "shipping_category_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "count_on_hand" integer DEFAULT 0 NOT NULL);
CREATE INDEX "index_products_on_available_on" ON "spree_products" ("available_on");
CREATE INDEX "index_products_on_deleted_at" ON "spree_products" ("deleted_at");
CREATE INDEX "index_products_on_name" ON "spree_products" ("name");
CREATE INDEX "index_products_on_permalink" ON "spree_products" ("permalink");
COMMIT;
